import React from 'react';
import './Viewpoints.css';

function Viewpoints() {
    return (
        <div>
            <a href="/AboutMe">
                <button className="About_Me"></button>
            </a>
            <a href="/Projects">
                <button className="Projects"></button>
            </a>
            <a href="/">
                <button className="Skills"></button>
            </a>
        </div>
    );
}

export default Viewpoints;
